import {useState , useEffect} from 'react';
function Custome(e, p){
const [email , setEmail] = useState(e);
const [pass , setpass] = useState(p);

function Success(){
    window.alert('Login is success')
}
function Danger(){
    window.alert('Login is danger')
}
return{
    email ,pass , Success , Danger 
}
Handlechange= ()=>{
    if(e ==email && p ==pass)
    return Success;
 return Danger;
}
}
export default Custome ;
